class Solution(object):
    def majorityElement(self, nums):
        """
        编程之美的思路: 每次删除不同的两个数, 剩下的必为众数
        这个版本还是有问题的, 当存在大量重复元素时, 每次都从头开始寻找, 是一件很费力的活
        """

        while len(nums) > 1:
            a = nums[0]
            for b in nums[1:]:
                if b != a: break
            else:
                return a
            nums.remove(a)
            nums.remove(b)
        
        return nums[0]

